import React from 'react';
import { Link } from 'react-router-dom';

export default function DoctorSearch() {
  return (
    <div className="text-center mt-10">
      <h1 className="text-3xl font-bold text-blue-600 mb-6">Doctor Search Page</h1>

      <nav className="space-y-2">
        /*<Link to="/booking" className="block text-blue-500 hover:underline">Go to Booking</Link>
        <Link to="/confirmation" className="block text-blue-500 hover:underline">Go to Confirmation</Link>*/
        <Link to="/login" className="block text-blue-500 hover:underline">Go to Login</Link>
        /*<Link to="/signup" className="block text-blue-500 hover:underline">Go to Signup</Link>
        <Link to="/dashboard" className="block text-blue-500 hover:underline">Go to Dashboard</Link>
        <Link to="/chat" className="block text-blue-500 hover:underline">Go to Chat</Link>*/
      </nav>
    </div>
  );
}
